result:
query ($page: Int) {
  posts: allStrapiPost (perPage: 2, page: $page) @paginate {
    edges {
      node {
        id
        title
        tags {
          id
          title
        }
        created_at
      }
    }
    pageInfo {
      totalPages
      currentPage
    }
  }

  general: allStrapiGeneral {
        edges {
            node {
                id
                title
                subtitle
                cover {
                    url
                }
            }
        }
    }

}
